// import './Post.css';

/*
props: {
  title: string,
  subtitle: string,
  subpost: [
    {
      desc: string,
      imgPath: string,
    },
  ],
}
*/
function Post(props) {
  return (
    <div className="border border-3 margin-small padding-small">
      <article className="article">
        <h2 className="article-title text-center">Start University Life</h2>
        <p className="text-lead text-center">Binus University - Sept 2013</p>

        <div className="sm-12 md-12 text-center">
          <p>
            My first year in college life as Binusian 2017. This is a fullteam member of my program's. Computer Science and Statistic Program 2013.
          </p>
          <img src="images/himstat_2013.jpg" alt="CS-Stat 2013 Binus University" className="row flex-center article-image--half-size border-4" />
        </div>

        <div className="sm-12 md-12 text-center">
          <p>
            Semester 2, Last Calculus class, CS-Stat, CS-Math & Wikaria Gazali.
          </p>
          <img src="images/himstat_kalkulus.jpg" alt="CS-Stat 2013 Calculus Class Binus University" className="row flex-center article-image--half-size border-4" />
        </div>

        <div className="sm-12 md-12 text-center">
          <p>
            MATIC (Mathematic and Statistic Competition) event in 2013.
          </p>
          <img src="images/himstat_kalkulus.jpg" alt="Event Matic 2013 at Binus University" className="row flex-center article-image--half-size border-4" />
        </div>
      </article>
    </div>
  );
}

export default Post;
